import Rebase from 're-base';
import firebase from 'firebase';

const firebaseApp = firebase.initializeApp({
    apiKey: "AIzaSyDCUmXK881leRtJDQl8KyhzISfv8QfPHEU",
    authDomain: "yarn-shop.firebaseapp.com",
    databaseURL: "https://yarn-shop.firebaseio.com"
});

const base = Rebase.createClass(firebaseApp.database());

// named export
export {firebaseApp};

// default export
export default base;
